import{GithubApi}from"./api.min.js";export async function projectsList(){const containers=document.querySelectorAll("#project-list"),github=new GithubApi,githubData=await github.repos();containers.forEach(container=>{githubData.map(data=>{if(data.homepage){const project=document.createElement("div");project.innerHTML=`\n                    <h3>${data.name}</h3>\n                    <p>${data.description}</p>\n                    <div class="link-container">\n                        <a href="${data.homepage}">Demo</a>\n                        <a href="${data.html_url}">Github</a>\n                    </div>\n                `,project.classList.add("project-box"),container.appendChild(project)}})})}